  Texas COVID-19 Vaccine Tracker





  The reach of COVID-19 on Texas and the world has been devastating. As our state joins a global effort to put coronavirus into our past, we are tracking the Texas vaccine roll-out as it unfolds in real-time.
  Texas has 22,421,178 people above the age of 16 who are currently eligible for the vaccine. As of May 05, 2021, the state has:


   | Fully Vaccinated: 8,329,391 people or 37% of the population 16+  | Vaccinated w/ At Least One Dose: 11,292,655 people or 50% of the population 16+  | Administered: 48,454 doses in one day on May 05, 2021 or 0.22% of the population 16+  | A 7-Day Average of 111,440 administered per day or 0.50% of the population 16+



